import React, { useState } from "react";
import "./main.css";
function Main() {
  const [result,setresult]=useState("");
  const [darkMode,setDarkMode]=useState(false);
  const handleClick=(e)=>{
    setresult(result.concat(e.target.name))
  }

  const  darkHandle=()=>{
    setDarkMode(!darkMode)
  }
  
  const clear=()=>{
    setresult();
  }
  const calculate=()=>{
    try{
    setresult(eval(result).toString())
    }catch(error){
      setresult("Error")
    }
    
  }
  const lastRemove=()=>{
    setresult(result.slice(0,-1));
  }

  return (
    <>
      <div className="">
        <div  className="main">
        <div  className="display mb-2">
        
          <h3 className="text-end">{result}</h3>
          <i className="fa-regular fa-moon"></i>
          </div>
          <div  className="buttons">
            <button id="clear" onClick={clear}>AC</button>
            <button  className="clear" onClick={lastRemove}>
             C
            </button> 
            <button id="Normal_btn" className="clear" name="/"  onClick={handleClick}>/</button> 
            <button id="Normal_btn" className="clear" name="*"  onClick={handleClick}>*</button>
          </div> 
          <div  className="buttons">   
            <button id="Normal_btn" name="7"  onClick={handleClick}>7</button>
            <button id="Normal_btn" name="8"  onClick={handleClick}>8</button>
            <button id="Normal_btn" name="9"  onClick={handleClick}>9</button>
            <button id="Normal_btn" className="clear" name="-"  onClick={handleClick}>-</button>
          </div>
          <div  className="buttons">
             
            <button id="Normal_btn" name="4"  onClick={handleClick}>4</button> 
            <button id="Normal_btn" name="5"  onClick={handleClick}>5</button> 
            <button id="Normal_btn" name="6"  onClick={handleClick}>6</button> 
            <button id="Normal_btn" className="clear" name="+"  onClick={handleClick}>+</button> 
          </div> 
          <div  className="buttons">
             
            <button id="Normal_btn" name="1"  onClick={handleClick}>1</button> 
            <button id="Normal_btn" name="2"  onClick={handleClick}>2</button> 
            <button id="Normal_btn" name="3"  onClick={handleClick}>3</button> 
            <button id="Normal_btn" className="clear" name="."  onClick={handleClick}>.</button> 
          </div> 
          <div  className="buttons">
             
            <button id="Normal_btn" name="0"  onClick={handleClick}>0</button> 
            <button id="Normal_btn" name="00"  onClick={handleClick}>00</button> <button id="equalTo" onClick={calculate}>=</button> 
          </div> 
        </div> 
        <script src="script.js"></script>
      </div>
    </>
  );
}

export default Main;
